// Zoom Out 功能
d3.select('#zoomOutButton').on('click', () => {
    svg.transition().duration(500).call(
        zoom.scaleBy, 1 - zoomStep
    );
});


function updateLinks() {
    const selectedBookIds = new Set(
        d3.selectAll('input[name="bookId"]:checked')
            .data()
    );

    link.style('opacity', d => selectedBookIds.has(d.bookId) ? 1 : 0);
    selfLoop.style('opacity', d => selectedBookIds.has(d.bookId) ? 1 : 0);

    // 更新事件处理器，只有在opacity为1时才有效
    const updateMouseEvents = selection => {
        selection
            .on("mouseover", (event, d) => {
                if (selectedBookIds.has(d.bookId)) {
                    const x = event.pageX + 10;
                    const y = event.pageY + 10;
                    const tooltip = d3.select("body").append("div")
                        .attr("class", "tooltip")
                        .style("opacity", 0)
                        .style("left", x + "px")
                        .style("top", y + "px");

                    tooltip.transition()
                        .duration(200)
                        .style("opacity", .9);
                    tooltip.html("Book ID: " + d.bookId);  // 显示bookId
                }
            })
            .on("mouseout", (event, d) => {
                if (selectedBookIds.has(d.bookId)) {
                    d3.select(".tooltip").transition()
                        .duration(0)
                        .style("opacity", 0)
                        .remove(); // 移除tooltip元素
                }
            })

    };

    updateMouseEvents(link);
    updateMouseEvents(selfLoop);
}

const zoom = d3.zoom()
    .scaleExtent([3 / 4, 5])  // 设置缩放大小范围
    .on("zoom", zoomed);

svg.call(zoom);

// 重置缩放的函数
function resetZoom() {
    svg.transition().duration(750).call(
        zoom.transform,
        d3.zoomIdentity  // 设置为初始缩放状态
    );
}

// 绑定重置函数到按钮
d3.select('#resetZoomButton').on('click', resetZoom);

function zoomed(event) {
    container.attr("transform", event.transform);  // 缩放和平移容器

    // 根据缩放级别动态调整链接距离
    const newDistance = 400 * event.transform.k;  // 修改这里来调整距离
    linkForce.distance(link => {
        const key = link.source.id + "-" + link.target.id;
        const count = linkCount[key];
        return newDistance / count;  // 调整链接距离
    });
    simulation.alpha(0.3).restart();  // 重新启动模拟以应用新的力参数
}


